import React, { useEffect } from 'react';
import {
  Box, Button, Card, CardActions, CardActionArea, CardMedia, CardContent, Typography,
} from '@material-ui/core';

import Api from './api';

const App = () => {
  const api = new Api();
  return (
    <Box width={400}>
      <Card>
        <CardActionArea>
          <CardMedia
            src="https://yts.mx/assets/images/movies/athlete_a_2020/background.jpg"
            image="https://yts.mx/assets/images/movies/athlete_a_2020/background.jpg"
            title="Contemplative Reptile"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="h2">
              Lizard
            </Typography>
            <Typography variant="body2" color="textSecondary" component="p">
              Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
              across all continents except Antarctica
            </Typography>
          </CardContent>
        </CardActionArea>
        <CardActions>
          <Button size="small" color="primary">
            Share
          </Button>
          <Button size="small" color="primary">
            Learn More
          </Button>
        </CardActions>
      </Card>
    </Box>
  );
}

export default App;
